import * as React from 'react';
import './content.css';
import { Range } from 'react-range';
import DatePicker from "react-datepicker";
import "react-datepicker/dist/react-datepicker.css";
state = { values: [50] };
function Formbox() {

  return (
    <div className="box">
      <h1>Form</h1>

      <form>
        <select>
          <option value="Maanantai" selected>Maanantai</option>
          <option value="Tiistai">Tiistai</option>
          <option value="Keskiviikko">Keskiviikko</option>
          <option value="Torstai">Torstai</option>
          <option value="Perjantai">Perjantai</option>
          <option value="Lauantai">Lauantai</option>
          <option value="Sunnuntai">Sunnuntai</option>
        </select>

        <DatePicker
          showTimeSelect
          showTimeSelectOnly
          timeFormat="HH:mm"
          timeIntervals={15}
        />
        <DatePicker
          showTimeSelect
          showTimeSelectOnly
          timeFormat="HH:mm"
          timeIntervals={15}
        />

        <Range
          step={0.1}
          min={0}
          max={100}
          values={this.state.values}
          onChange={(values) => this.setState({ values })}
          renderTrack={({ props, children }) => (
            <div
              {...props}
              style={{
                ...props.style,
                height: '6px',
                width: '100%',
                backgroundColor: '#ccc'
              }}
            >
              {children}
            </div>
          )}
          renderThumb={({ props }) => (
            <div
              {...props}
              style={{
                ...props.style,
                height: '42px',
                width: '42px',
                backgroundColor: '#999'
              }}
            />
          )}
        />


      </form>

    </div>
  );
}

export default Formbox;
